Step-by-step reasoning:

1. Key psychological mechanisms: Responder decisions are largely driven by self‐interest (the direct monetary gain) but are modulated by fairness considerations. A responder compares the proportion of money offered (split_self relative to the combined_earning) with a fairness benchmark derived from their token contribution (token_self relative to total tokens). If the offer’s monetary share exceeds what is “fair” given one’s contribution, additional utility is gained; if it falls short, utility is reduced.

2. Mechanism interaction: The monetary payoff (self-interest) is multiplied by an adjustment factor that reflects fairness deviation. This multiplicative adjustment is proportional to the difference between the actual share ratio (split_self/combined_earning) and the equitable share ratio (token_self/(token_self+token_opp)). Thus, an above-fair offer boosts the effective value of the monetary gain and a below-fair offer diminishes it.

3. Mathematical form: We propose a multiplicative model where utility for accepting an offer is given by the self-interest component scaled by a fairness adjustment factor. This gives: 
  U_accept = gamma × split_self × [1 + lambda_param × ((split_self / combined_earning) − (token_self / (token_self + token_opp)))]
Here gamma scales the monetary payoff, whereas lambda_param governs the sensitivity to the fairness discrepancy.

4. Learnable parameters: The two learnable parameters are gamma (self-interest sensitivity) and lambda_param (fairness sensitivity). They are bounded to be within finite intervals.

5. Mapping to observable behavior: The available observables (split_self, combined_earning, token_self, token_opp) are used to compute the actual share ratio and the fairness reference point. The computed utility (U_accept) is then used to predict whether a respondent will accept the offer. Negative values of U_accept indicate an unlikely choice (acceptance).

Below is the formal computational model specification:

<MODEL>
U_accept = gamma * split_self * (1 + lambda_param * ((split_self / combined_earning) - (token_self / (token_self + token_opp))))
</MODEL>

